  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;The Cryogenic Propellant Storage
  and Transfer project will demonstrate the capability to safely and efficiently store,
  transfer and measure cryogenic propellants, including liquefied and super-cooled
  fuels and oxidizers. These advances will lead to development of next-generation
  space transportation systems capable of managing large propellant volumes over long
  time periods necessary for deep space travel.&amp;nbsp; NASA&amp;rsquo;s Human Exploration
  and Operations Mission Directorate is a primary customer and new opportunities will
  follow for the agency&amp;rsquo;s industry partners.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;CPST:
  Key Mission Facts&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;- The Cryogenic Propellant Storage
  &amp;amp; Transfer mission will demonstrate technologies required for the development
  of in-space cryogenic systems to support exploration beyond low-Earth orbit.&lt;br
  /&gt;- The mission will support multiple human architecture elements&lt;br /&gt;-
  It is designed to demonstrate long-duration, storage and transfer of cryogenic propellants.&lt;br
  /&gt;- It will demonstrate an accurate and reliable gauging system for tracking
  stored propellant.&lt;/p&gt;\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
